import { useState } from "react";
import "./chatStyles.css";

export default function() {
    const [msg, setMsg] = useState([{
        class: "otherUser",
        message: "Everybody's got opinions on our thing Say we're flying down a path with no ending And if I die before I wake Ooh, don't let me wake up from this dream"
    },
    {
        class: "ogUser",
        message: "When we collide When we collide, it's a beautiful disaster When I crash into you, you, you Crash into you, you"
    }]);
    return (
        <>
            <section className="chatContainer">
                <div className="banner"></div>
                <div id="messages">
                    <div className="msg otherUser">
                        Everybody's got opinions on our thing
                        Say we're flying down a path with no ending
                        And if I die before I wake
                        Ooh, don't let me wake up from this dream
                    </div>
                    <div className="msg ogUser">
                        When we collide
                        When we collide, it's a beautiful disaster
                        When I crash into you, you, you
                        Crash into you, you
                    </div>

                </div>
                <div className="messageBox">
                    <form id="form" action="">
                    <input id="input" autoComplete="off" /><button>Send</button>
                    </form>
                </div>
            </section>
        </>
    )
}
